import React from 'react';
import '../App.css';
import {useDispatch} from "react-redux";
import {deleted} from "../actions/index";


export const Task = (list) =>{
    const dispatch = useDispatch();
    return (
        <>
        <ul>
            <li> {list.list.val} </li> 
            <button onClick =  {() => list.list.fun1(list.list.index)} > edit </button> 
            <button onClick =  {() => dispatch(deleted(list.list.index))} > delete </button> 
            {list.list.bool ?<button onClick =  {() => list.list.fun3(list.list.index)} > completed </button> : ""}    
            </ul> 
        </>   
    )
};
